    "    ]),\n",
    "}\n",
    "\n",
    "image_datasets = {\n",
    "    x: datasets.ImageFolder(os.path.join(BASE_DIR, x), transform=data_transforms[x])\n",
    "    for x in [\"train\", \"val\"]\n",
    "}\n",
    "\n",
    "dataloaders = {\n",
    "    x: DataLoader(image_datasets[x], batch_size=16, shuffle=True, num_workers=2)\n",
    "    for x in [\"train\", \"val\"]\n",
    "}\n",
    "\n",
    "dataset_sizes = {x: len(image_datasets[x]) for x in [\"train\", \"val\"]}\n",
    "class_names = image_datasets[\"train\"].classes\n",
    "\n",
    "print(\"Classes:\", class_names)\n",
    "print(\"Train size:\", dataset_sizes[\"train\"], \"| Val size:\", dataset_sizes[\"val\"])\n"
